import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { SnackbarProvider } from './context/SnackbarContext';

ReactDOM.render(
  <React.StrictMode>
    <SnackbarProvider>
      <App />
    </SnackbarProvider>
  </React.StrictMode>,
  document.getElementById('root')
);
